import { Route, Routes } from "react-router-dom";
import "./App.css";
import BaseLayout from "./components/layout/BaseLayout";
import Header from "./components/Header";
import Porductsave from "./components/product/Productsave";
import Blog from "./components/blog/Blog";
import BlogUserProduct from "./components/blog/BlogUserProduct";
import Productlist from "./components/product/Productlist";
import Footer from "./components/Footer";
import PaymentPage from "./components/pay/PaymentPage";
import PaymentCompletePage from "./components/pay/PaymentCompletePage";

function App() {
  return (
    <div className="container">
      <Header />
      <Routes>
        <Route path="/" element={<Blog />} />
        {/* <Route path="/" element={<BaseLayout />} /> */}
        <Route path="/seller/product/list" element={<Productlist />} />
        {/* <Route path="/seller/product/list" element={<Productlist />} /> */}
        <Route path="/seller/product/save" element={<Porductsave />} />

        {/* <Route path="/" element={<Blog />} /> */}
        {/* <Route path="/blog" element={<Blog />} /> */}
        <Route
          path="/blog/user/product/:product_code"
          element={<BlogUserProduct />}
        />
        <Route exact path="/payment/:product_code" element={<PaymentPage />} />
        <Route path="/payment/complete" element={<PaymentCompletePage />} />
      </Routes>

      <Footer />
    </div>
  );
}

export default App;
